const themepaletteStyle = theme => ({
    container: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "row",
        justifyContent: "space-evenly",
        width: "100%"
    },
    innercontainer: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "column",
        justifyContent: "flex-start",
    },
    sliderpicker:{
        width: "90%"
    },
    blockpicker:{
        marginTop: "1rem"
    },
    inputbutton:{
        margin: "1rem"
    }
})

export default themepaletteStyle;
